import React, { useRef } from 'react';
import "./App.css";
import { Blog, Features, Footer, Header, Possibility, WhatGPT3 } from "./containers";
import { CTA, Brand, Navbar } from "./components";

function App() {
  const ctaRef = useRef(null); // Create a reference for the CTA component

  return (
    <div className="App">
      <div className="gradient__bg">
        <Navbar />
        <Header />
      </div>
      <Brand />
      <WhatGPT3 />

      <Possibility ctaRef={ctaRef} /> {/* Pass the ref to Possibility */}
      <Features />
      <CTA ref={ctaRef} /> {/* Attach the ref to the CTA component */}
      <Blog />
      <Footer />
    </div>
  );
}

export default App;
